{"cluster":"help.kusto.windows.net","database":"Samples","query":"alias database db = cluster('apply_attribute lens:value:Cluster?<help>').database('apply_attribute lens:value:Database?<Samples>');
let filters = datatable(Description:string,Url:string,Workspace:string)[];
//
let opRegex = "([^/]+)/?.*/PROVIDERS/([^/]+)/(.*[^/])/?";
//
let extractOperation = (s:string) { extract(opRegex, 1 , s) };
let extractResourceProvider = (s:string) { extract(opRegex, 2 , s) };
let extractResourceType = (s:string) { extract(opRegex, 3 , s) };
//
let filterOperation = (s:string) { s contains "PROVIDERS" };
let isSuccess = (i:int) { i in (200,201,202) };
let isFailure = (i:int) { i !in (200,201,202,404) };
union database("db").["ETL-Microsoft-AzureStack-Frontdoor.HttpIncomingRequestEndWith*"]
    | where filterOperation(OperationName) and HttpStatusCode != 404
    | project HttpStatusCode, DurationInMilliseconds, OperationName, ApiVersion
    | summarize Total = count(),
        Fail = countif(isFailure(HttpStatusCode)), 
        Pass = countif(isSuccess(HttpStatusCode)),
        MinRTMs = min(DurationInMilliseconds),
        95thRTMs = percentile(DurationInMilliseconds,95),
        StdDev = stdev(DurationInMilliseconds),
        RelStdDev = 100 * stdev(DurationInMilliseconds)/avg(DurationInMilliseconds)
        by OperationName,ApiVersion
    | project 
        ResourceProvider = extractResourceProvider(OperationName),
        Operation = extractOperation(OperationName), 
        ResourceType = extractResourceType(OperationName),
        ApiVersion,
        Total,
        PassPct = round(100*Pass/todouble(Total),2), 
        FailPct = round(100*Fail/todouble(Total),2), 
        Reliability = round(100.0 * Pass/Total,2), 
        MinRTMs , round(95thRTMs,2) , 
        round(StdDev,2), 
        round(RelStdDev,2)
    | sort by Reliability asc;
filters
| extend Cluster='apply_attribute lens:value:Cluster?<help>', Database='apply_attribute lens:value:Database?<Samples>'
