{"cluster":"help.kusto.windows.net","database":"Samples","query":"alias database db = cluster('apply_attribute lens:value:Cluster?<help>').database('apply_attribute lens:value:Database?<Samples>');
let view = datatable(OccurrenceTime:datetime,SummaryInfo:string,SummaryFile:string,LogFile:string)[];
let searchFileNameRegex = @"AzureStack_Validation_(Summary|Trace)_([_\d\.]*)(.HTML|.html|.log|.LOG)";
let timeExtractionRegex = @"(\d{4}).(\d{2}).(\d{2})_(\d{2}).(\d{2}).(\d{2})";
let searchTerm = "AzureStack Cloud Validation Result:";
let replaceString = @"\1-\2-\3 \4:\5:\6";
let ExtractTimeFromFileName = (fileName:string){todatetime(replace(timeExtractionRegex,replaceString,extract(searchFileNameRegex,2,fileName)))};
union isfuzzy=true view,(
    database('db').TextFileLogs
    | where FileName matches regex searchFileNameRegex
    | extend Summary=extract(@"(\d\d\/\d\d\/\d\d\d\d \d\d:\d\d:\d\d) AzureStack Cloud Validation Result: (\w*)",2,FileLineContent)
//    | extend XRP=extract(@"([A-Z.]*) Azure Stack Fabric Management Controller Service Fabric Cluster",1,FileLineContent)
