let schema=datatable(ServerFail:long,OperationName:string,Total:long,StatusCodeCounts:dynamic)[];
let opRegex = "([^/]+)/?.*/PROVIDERS/([^/]+)/(.*[^/])/?";
let filterOperation = (s:string) { s contains "PROVIDERS" };
let isSuccess = (i:int) { i/100 == 2 or i == 404 };
let isServerFailure = (i:int) { i/100 == 5 };
let isClientFailure = (i:int) { i != 404 and i/100 == 4 };
let extractResourceProvider = (s:string) { extract(opRegex, 2 , s) };
union isfuzzy=true schema,(
    union database("db").["ETL-Microsoft-AzureStack-Frontdoor.HttpIncomingRequestEndWith*"]
    | apply_attribute lens:time:OccurrenceTime
    | where filterOperation(OperationName)
    | where extractResourceProvider(OperationName) == 'MICROSOFT.NETWORK'
    | project HttpStatusCode, DurationInMilliseconds, OperationName, ApiVersion
    | summarize count() by OperationName,HttpStatusCode
    | summarize Total = sum(count_),
        ServerFail = sumif(count_,isServerFailure(HttpStatusCode)),
        ClientFail = sumif(count_,isClientFailure(HttpStatusCode)),
        Pass = sumif(count_,isSuccess(HttpStatusCode)),
        StatusCodeCounts = makelist(pack("StatusCode",HttpStatusCode,"Count",count_))
        by OperationName
    | project ServerFail,OperationName,Total,StatusCodeCounts  
    | where ServerFail > 0
    | sort by ServerFail desc
    | take 3    
)
